const Navigation = ({ accounts }) => {
  return (
    <nav>
      <div>Web3 Storage</div>
      <div>{accounts.slice(0, 6) + "..." + accounts.slice(38, 42)}</div>
    </nav>
  );
};

export default Navigation;
